style.css:
/* Muda a cor de fundo da página */
body {
    background-color: #1a1a1a; /* Fundo escuro */
    color: #ffffff; /* Texto branco */
}

/* Estilo dos títulos */
h1, h2, h3 {
    color: #ffcc00; /* Títulos em amarelo */
    text-align: center; /* Centraliza os títulos */
}

/* Estilo dos links */
a {
    color: #00ccff; /* Links em azul claro */
}

/* Muda o estilo dos botões */
button {
    background-color: #ff5500; /* Fundo dos botões em laranja */
    color: white; /* Texto dos botões em branco */
    border: none; /* Remove bordas */
    padding: 10px; /* Espaçamento interno */
    border-radius: 5px; /* Bordas arredondadas */
    cursor: pointer; /* Muda o cursor para uma mão ao passar por cima */
}
